profiledesc.descrules:
Deze toegang is vervaardigd met inachtneming van de volgende richtlijnen: 
					ISAD (G) : General International Standard Archival Description, second edition, Ottawa 2000;
					Archiefterminologie voor Nederland en Vlaanderen, Stichting Archiefpublicaties, 's-Gravenhage 2003.

scopecontent.p:
De registers bevatten per persoon de volgende gegevens: 


naam, geboortedatum en geboorteplaats;


namen van de ouders (soms beroep van de vader);


aanstelling, duur van het aangegane dienstverband, promoties en ontslag;


vermelding van de actieve dienst op zee;


vermelding van gedane veld- of zeetochten, bekomen verwondingen, uitstekende daden of bijzondere verrichtingen;


vermelding van toegekende onderscheidingen, opleiding, talenkennis.

					Niet elke serie is even uitgebreid: er zijn ook registers die niet veel meer dan een namenlijst bevatten.

arrangement.p:
Het totale archiefbestand (693 bestanddelen) bestaat uit een aantal hoofdseries: 


Stamboeken marine officieren, 1814 - 1940 fragmentarisch doorlopend tot en met 1949;


Registers van aangenomen manschappen en scheeps- of soldijrollen 1813 - 1832 met een enkel register uit later tijd;


Stamboeken onderofficieren en schepelingen 1814 - 1940;


Stamboeken van het personeel der rijksmarinewerven, 1860 - 1915.

					De series stamboeken zijn primair ingedeeld naar rang: A officieren en B onderofficieren en manschappen. Daarbinnen zijn subseries te onderscheiden naar categorie: officieren zeedienst, officieren van gezondheid, officieren van het Korps Mariniers resp. schepelingen, zeemiliciens, vrijwillige marinereserve, mariniers. Per subserie staan de registers chronologische of op nummervolgorde van de inschrijvingen.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 


U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;


Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;


In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;


Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;


Vervolgens bevestigt u uw reservering door deze te versturen.
